Promotional info - &quot;In a world where monsters roam freely, some stories have been lost to time... until NOW! Focusing on Godzilla's fearsome rogues gallery, each story in Godzilla: Legends shines a light on a kaiju that has never before been the center of a comic book story. These stories delve into the minds of Anguirus, Rodan, Titanosaurus, Hedorah, and Kumonga to bring the TOHO universe to life! This collection also includes an incredible cover gallery by legendary Godzilla artists Chris Scalf, Bob Eggleton, and Art Adams.&quot;

This is the digital copy of the TPB by Tyrant Lizard King-Empire, the HD version. Thanks to them for their efforts, please seed and enjoy! :-)

